import ReactFullpage from '@fullpage/react-fullpage';
import { BlogArea } from './Components/Area/BlogArea'

const setting = {
  scrollingSpeed: 1000,
  navigation: true,
  navigationPosition: 'left',
  navigationSize: 'large',
  navigationColor: '#fff',
}

function App() {
  return (
    <>
      <ReactFullpage
        //fullpage options
        scrollingSpeed={1000} 
        navigation
        render={({ state, fullpageApi }) => {
          return (
            <ReactFullpage.Wrapper>
              <div className="section">page1</div>
              <div className="section">page2</div>
              <BlogArea />
            </ReactFullpage.Wrapper>
          );
        }}
      />
    </>
  );
}

export default App;
